angular.module('yhAnimations', ['ngAnimate']);;
var yhApp = angular.module('Yellowhammer', [
  'ngRoute',
  'yhAnimations',
  'yhControllers',
  'yhServices',
  'yhDirectives',
  'yhFilters']);

yhApp.config(['$routeProvider',
  function($routeProvider) {
    $routeProvider.
      when('/', {
        templateUrl: 'partials/file-list.html',
        controller: 'MainCtrl'
      })
      .otherwise({
        redirectTo: '/'
      });
  }]);;
'use strict';

var yhControllers = angular.module('yhControllers', ['yhServices', 'yhDirectives']);

yhControllers.controller('LoginCtrl', ['$scope', 'user', 's3Service', 
  function($scope, user, s3Service) {
    var s3;   // later used for S3 API interaction

    $scope.loginToS3 = function(prefix, accessKey, secretKey, bucket) {
      s3Service.setCreds(prefix, accessKey, secretKey, bucket);
    };
}]);

yhControllers.controller('S3Ctrl', ['$scope', 'user', 's3Service', 'dragAndDrop', 
  function($scope, user, s3Service, dragAndDrop){

    $scope.$on('user::loggedIn', function() {    
      $scope.isLoggedIn = user.getLoginStatus();
    });

    $scope.$on('s3creds::changed', function() {
      $scope.creds = s3Service.getCreds();
      s3 = new AWS.S3({ params:{ Bucket: $scope.creds.bucket }})
      $scope.retrieveBucketFiles();
      $scope.orderProp = '-LastModified';
    });

    //------------------------------------------------------
    // CRUD ACTIONS
    //------------------------------------------------------

    $scope.retrieveBucketFiles = function() {
      s3.listObjects({ 
        Bucket: $scope.creds.bucket,    // required fields
        Prefix: $scope.creds.prefix
      }, function(err, data) {
        if (err) { console.log(err); }  // error occurred
        else {

          // sign in user if not already logged in
          if( !user.getLoginStatus() ){
               user.setLoginToTrue();
               dragAndDrop.activate();
          }

          // add S3 bucket files to $scope.files and update view
          $scope.files = data.Contents;
          $scope.$apply();
        }
      })
    }

    $scope.uploadFileToS3 = function() {
      $scope.uploadProgress = 0;
      var file = document.getElementById('fileUpload').files[0];
      
      s3.putObject({
        // required fields to access S3 bucket
        Key:  $scope.creds.prefix + '/' + file.name,  // ex. johndoe/file.jpg
        Body: file,
        ACL:  "public-read"
      }, function(err, data) {
        if (err) { console.log(err); } // error ocurred
        else { 
          $scope.retrieveBucketFiles();

          // Reset the forms & progress bar
          document.getElementById('uploadFileForm').reset();
          document.getElementById('dropbox').innerHTML = '<h2>Drag and Drop Files</h2>'
          setTimeout(function() {
            $scope.uploadProgress = 0;
            $scope.$digest();
          }, 2500);
        }
      }) // this is what updates the progress bar live
      .on('httpUploadProgress',function(progress) {
        $scope.uploadProgress = Math.round(progress.loaded / progress.total * 100);
        $scope.$digest();
      });
    }

    $scope.editFileName = function() {
      // AWS S3 doesn't allow file name changes so instead, we:
      // 1. GET old file & copy it
      // 2. PUT the copied file back to S3 with new name
      // 3. DELETE old file

      var fileCopy;
      $scope.newFileName = this.newFileName;
      
      // GET old file
      s3.getObject({ 
        Bucket: $scope.creds.bucket, 
        Key:    $scope.oldFileName 
      }, function(err, data) {
        if (err) console.log(err, err.stack);   // error occurred
        else {
          // copy file and PUT it back to S3 with new name
          fileCopy = data;
          s3.putObject({ 
            Key: $scope.creds.prefix + '/' + $scope.newFileName, 
            ACL: "public-read", 
            Body: fileCopy.Body 
          }, function(err, data){
            if (err) console.log(err);
            else { $scope.retrieveBucketFiles(); }  // update view
          })
        }
      });

      // Delete old file
      s3.deleteObject({ 
        Bucket: $scope.creds.bucket, 
        Key:    $scope.oldFileName 
      }, function(err, data){
        if (err) console.log(err);
      })

    } // end of editFileName()

    $scope.deleteFileFromS3 = function(file) {
      var confirmed = confirm("Are you sure you want to delete " + file.Key + "?")
      if (confirmed) {
        s3.deleteObject({
          Bucket: $scope.creds.bucket,
          Key: file.Key
        }, function(err, data) {
          if (err) { console.log(err, err.stack);  } // error occurred
          else     { $scope.retrieveBucketFiles(); }
        });
      } 
    }

    // ------------------------------------------------------
    // MANAGING STATE
    // ------------------------------------------------------

    $scope.newFileName = null;
    $scope.oldFileName = null;

    $scope.showEditForm = function(currentFileName) {
      $scope.newFileName = currentFileName.slice(8, (currentFileName).length);
      $scope.oldFileName = currentFileName;
    }

    $scope.isEditing = function(fileName) {
      return fileName === $scope.oldFileName;
    }

    $scope.stopEditing = function() {
      $scope.oldFileName = null;
    }
}]);;
'use strict';

var yhDirectives = angular.module('yhDirectives', []);

yhDirectives.directive('loginSection', function() {
  return {
    restrict: 'E',
    templateUrl: 'partials/login-panel.html'
  };
});

yhDirectives.directive('uploadForm', function() {
  return {
    restrict: 'E', 
    templateUrl: 'partials/upload-form.html'
  };
});

yhDirectives.directive('fileListing', function() {
  return {
    restrict: 'E',
    templateUrl: 'partials/file-listing.html'
  };
});;

angular.module('yhFilters', []).filter('sizeCheck', function() {
  return function(input) {
    return input ? '\u2713' : '\u2718';
  };
});;
var yhServices = angular.module('yhServices', []);

yhServices.service('dragAndDrop', function() {
  return {
    activate: function() {
      var dropbox, inputbox;

      dropbox = document.getElementById("dropbox");
      input = document.getElementById('fileUpload');
      dropbox.addEventListener("dragenter", dragenter, false);
      dropbox.addEventListener("dragover", dragover, false);
      dropbox.addEventListener("dragleave", dragleave, false);
      dropbox.addEventListener("drop", drop, false);

      function dragenter (e) {
        e.stopPropagation();
        e.preventDefault();
      }

      function dragover(e) {
        e.stopPropagation();
        e.preventDefault();
        dropbox.style.border = '5px dashed green';
      }

      function dragleave(e) {
        e.stopPropagation();
        e.preventDefault();
        dropbox.style.border = '5px dashed black';
      }

      function drop(e) {
        e.stopPropagation();
        e.preventDefault();

        var dt = e.dataTransfer;
        var files = dt.files;
        input.files[0] = files[0];
        dropbox.innerHTML = '<h2>' + files[0].name + '</h2>';
      }
    }
  }
});

yhServices.service('user', ['$rootScope', function($rootScope) {
  this.login = { status: false };
  var self = this;

  return {
    getLoginStatus: function() {
      return self.login.status;
    },
    setLoginToTrue: function() {
      self.login.status = true;
      $rootScope.$broadcast('user::loggedIn');
    }
  };
}]);

yhServices.service('s3Service', ['$rootScope', function($rootScope) {
  this.creds = {  
    prefix:     null,
    accessKey:  null,
    secretKey:  null,
    bucket:     null
  };
  var self = this;

  return {
    getCreds: function() {
      return self.creds;
    },
    setCreds: function(prefix, accessKey, secretKey, bucket) {
      self.creds.prefix    = prefix;
      self.creds.accessKey = accessKey;
      self.creds.secretKey = secretKey;
      self.creds.bucket    = bucket;

      AWS.config.update({
        accessKeyId:     accessKey,
        secretAccessKey: secretKey
      });

      $rootScope.$broadcast('s3creds::changed');
    }
  }
}]);